import React from "react";
import './discounts.css';
import pyaterochka from '../../img/pyaterochka.webp'


function Discount(){
    return(
        <div className="discounts">
            <div className="discount">
                <img className="discount__image"
                src={pyaterochka}
                />
            </div>

        </div>
    );
};

export default Discount;
